import { createTheme } from "@mui/material/styles";

export const theme = createTheme({
  components: {
    MuiCssBaseline: {
      styleOverrides: {
        "@global": {
          "*": {
            margin: 0,
            padding: 0,
          },
          "html, body, #root": {
            height: "100%",
          },
          ul: {
            listStyle: "none",
          },
        },
      },
    },
    overrides: {
      MuiSvgIcon: {
        root: {
          verticalAlign: "middle",
        },
      },
    },
  },
});
